import './App.css';
import Heading from './components/Heading';
import Footer from './components/Footer';
import Note from './components/Note';
import Card from './components/Card';

function App() {
  return (
    <div>
      <h1>My contacts</h1>
      <Card name="michal" telephone="123 456" email="michal@gmail.com" />
      <Card name="angel" telephone="789 101" email="angela@gmail.com" />
    </div>
  );
}

export default App;
